import React from 'react'
import './Hardware.css'

const Hardware = () => {
  return (
    <div className='hardware'>
        <div className='content'>
          <h1>2023 Summer</h1>
          <h1>2022 Summer</h1>
        </div>
    </div>
  )
}

export default Hardware
